package basics;

public class DoWhileLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a1= 1;//initialization
        do {
        System.out.println(a1+") jagan");
        a1++;
        }while(a1<6);
        int a2= 6;//initialization
        do {
        System.out.println("jack");
        a2--;
        }while(a2>1);
	}

}
